import './Dashboard.css'; // –î–æ–¥–∞–º–æ CSS —Ñ–∞–π–ª –¥–ª—è —Å—Ç–∏–ª—ñ–≤

const Dashboard = () => {
  // –î–∏–Ω–∞–º—ñ—á–Ω—ñ —Å—Ç–æ—Ä—ñ–Ω–∫–∏, —è–∫—ñ –º–æ–∂–Ω–∞ —Ä–µ–¥–∞–≥—É–≤–∞—Ç–∏
  const dynamicPages = [
    { 
      name: '–ì–∞–ª–µ—Ä–µ—è', 
      path: 'gallery', 
      description: '–†–µ–¥–∞–≥—É–≤–∞–Ω–Ω—è –≥–∞–ª–µ—Ä–µ—ó —Ñ–æ—Ç–æ —Ç–∞ –≤—ñ–¥–µ–æ', 
      icon: 'üñºÔ∏è', 
