  ];

  // –ö–∞—Ä—Ç–∫–∏ –∫–µ—Ä—É–≤–∞–Ω–Ω—è –∫–æ–Ω—Ç–µ–Ω—Ç–æ–º
  const contentManagementCards = [
    {
      name: '–ö–µ—Ä—É–≤–∞–Ω–Ω—è –Ω–æ–≤–∏–Ω–∞–º–∏',
