      icon: 'üì∞',
      color: '#9b59b6',
      badge: '‚öôÔ∏è –ü–æ–≤–Ω–µ —É–ø—Ä–∞–≤–ª—ñ–Ω–Ω—è',
      badgeColor: '#f4ecf7',
      textColor: '#8e44ad'
    },
    {
      name: '–ö–µ—Ä—É–≤–∞–Ω–Ω—è –≥–∞–ª–µ—Ä–µ—î—é',
      path: '/admin/gallery-management',
      description: '–î–æ–¥–∞–≤–∞–Ω–Ω—è, —Ä–µ–¥–∞–≥—É–≤–∞–Ω–Ω—è —Ç–∞ –≤–∏–¥–∞–ª–µ–Ω–Ω—è —Ñ–æ—Ç–æ —É –≥–∞–ª–µ—Ä–µ—ó',
